$(document).ready(function(){$.when($("head").append('<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/bootstrap-star-rating/4.0.1/css/star-rating.min.css" type="text/css" />'),$.getScript("//cdnjs.cloudflare.com/ajax/libs/bootstrap-star-rating/4.0.1/js/star-rating.min.js"),$.Deferred(function(deferred){$(deferred.resolve)})).done(function(){$(".star-rating").rating({min:1,max:5,step:1,size:"lg",showCaption:true})})});